import React from "react";
import "./index.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faUsers,
  faStar,
  faCode,
  faWallet,
} from "@fortawesome/free-solid-svg-icons";

class Card extends React.Component {
  constructor(props) {
    super(props);
  }
  openNewPage = () => {
    window.open(this.props.htmlUrl);
  };

  render() {
    const {
      listNum,
      avatar,
      name,
      starsCount,
      forksCount,
      openIssuesCount,
    } = this.props;

    const itemDetStyle = {
      margin: "0 auto",
    };

    const listUserIcon = {
      color: "orange",
      width: "20px",
    };

    const listStarIcon = {
      color: "yellow",
      width: "20px",
    };

    const listForkIcon = {
      color: "skyblue",
      width: "20px",
    };

    const listIssueIcon = {
      color: "pink",
      width: "20px",
    };

    return (
      <div className="github-list d-flex flex-column" onClick={this.openNewPage}>
        <span className="listNumber">#{listNum}</span>
        <img src={avatar} alt="" className="listAvatar" />
        <p className="listName">{name}</p>
        <div style={itemDetStyle}>
          <div style={{ marginBottom: "5px" }}>
          <i  class="fa fa-user"></i>
            <span style={{ fontWeight: "bold" }}> {name}</span>
          </div>
          <div style={{ marginBottom: "5px" }}>
          <i style={{ color: '#ffd700', width: 20, height: 20, paddingLeft: 3, paddingRight: 25 }} class="fa fa-star"></i>
            <span>{starsCount} stars</span>
          </div>
          <div style={{ marginBottom: "5px" }}>
            <FontAwesomeIcon style={listForkIcon} icon={faCode} />
            <span>{forksCount} forks</span>
          </div>
          <div>
            <FontAwesomeIcon style={listIssueIcon} icon={faWallet} />
            <span>{openIssuesCount} open issues</span>
          </div>
        </div>
      </div>
    );
  }
}

export default Card;
